import React from "react";

function BuyPriceBtn({ top }) {
  return (
    <div
      style={{ "margin-top": top, "background-color": "#333" }}
      className="w-full text-center p-2 rounded-lg text-white">
      <button> Buy this plan</button>
    </div>
  );
}

export default BuyPriceBtn;
